import{_ as e,c as t,o as a,a4 as i}from"./chunks/framework.BmdFiWrL.js";const m=JSON.parse('{"title":"Agent FAQ","description":"","frontmatter":{"outline":"deep"},"headers":[],"relativePath":"en_US/guide/agentq.md","filePath":"en_US/guide/agentq.md","lastUpdated":1740914849000}'),n={name:"en_US/guide/agentq.md"},s=i('<h1 id="agent-faq" tabindex="-1">Agent FAQ <a class="header-anchor" href="#agent-faq" aria-label="Permalink to &quot;Agent FAQ&quot;">​</a></h1><hr><h2 id="why-is-the-ip-displayed-in-the-dashboard-different-from-the-agent-s-actual-ip" tabindex="-1">Why is the IP displayed in the Dashboard different from the Agent&#39;s actual IP? <a class="header-anchor" href="#why-is-the-ip-displayed-in-the-dashboard-different-from-the-agent-s-actual-ip" aria-label="Permalink to &quot;Why is the IP displayed in the Dashboard different from the Agent&#39;s actual IP?&quot;">​</a></h2><p>If the IP displayed in the Dashboard is inconsistent with the Agent&#39;s actual IP, please refer to <a href="/en_US/guide/dashboardq.html">Dashboard FAQ - Why is the IP shown in the management panel different from the Agent&#39;s actual IP?</a>.<br> Detailed solutions to this issue are provided in the related document and will not be repeated here.</p><hr><h2 id="errors-during-one-click-script-installation" tabindex="-1">Errors During One-Click Script Installation <a class="header-anchor" href="#errors-during-one-click-script-installation" aria-label="Permalink to &quot;Errors During One-Click Script Installation&quot;">​</a></h2><h3 id="_1-curl-failed-to-connect-to-raw-githubusercontent-com" tabindex="-1">1. <code>curl: Failed to connect to raw.githubusercontent.com......</code> <a class="header-anchor" href="#_1-curl-failed-to-connect-to-raw-githubusercontent-com" aria-label="Permalink to &quot;1. `curl: Failed to connect to raw.githubusercontent.com......`&quot;">​</a></h3><p>This issue commonly occurs on servers located in Mainland China due to unstable connections to GitHub. Solutions include:</p><ol><li><strong>Retry the script multiple times</strong>: Simply rerun the one-click installation script a few more times.</li><li><strong>Manual Installation</strong>: Follow the guide for <a href="/en_US/guide/agent.html#alternative-methods-to-install-the-agent">manual Agent installation</a>.</li><li><strong>Use an acceleration service</strong>: Utilize third-party GitHub acceleration services or mirrors. Replace the download URL in the installation script with the accelerated link.</li></ol><hr><h3 id="_2-sudo-command-not-found" tabindex="-1">2. <code>sudo: command not found</code> <a class="header-anchor" href="#_2-sudo-command-not-found" aria-label="Permalink to &quot;2. `sudo: command not found`&quot;">​</a></h3><p>If the error <code>sudo: command not found</code> appears, it means the <code>sudo</code> tool is not installed on the target server. Solutions include:</p><ol><li><p><strong>Install <code>sudo</code> manually</strong>:</p><ul><li>For Ubuntu systems:<div class="language-shell vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">apt</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> sudo</span></span></code></pre></div></li><li>For CentOS systems:<div class="language-shell vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">shell</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">yum</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> install</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> sudo</span></span></code></pre></div></li></ul></li><li><p><strong>Verify installation</strong>: After installing <code>sudo</code>, rerun the one-click installation script.</p></li></ol><hr><h2 id="multiple-configuration-files-appearing-in-the-agent-installation-directory-and-multiple-agent-services-installed-on-the-system" tabindex="-1">Multiple Configuration Files Appearing in the Agent Installation Directory, and Multiple Agent Services Installed on the System <a class="header-anchor" href="#multiple-configuration-files-appearing-in-the-agent-installation-directory-and-multiple-agent-services-installed-on-the-system" aria-label="Permalink to &quot;Multiple Configuration Files Appearing in the Agent Installation Directory, and Multiple Agent Services Installed on the System&quot;">​</a></h2><p>This issue occurs because the Agent installation script was run multiple times. The Agent supports installing multiple system services based on different configuration files, so the script does not overwrite the existing installation but instead installs new configurations as separate system services.</p><p>You can use the Agent script&#39;s uninstall function to remove all configuration files and their associated services:</p><div class="language-bash vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6F42C1;--shiki-dark:#B392F0;">./agent.sh</span><span style="--shiki-light:#032F62;--shiki-dark:#9ECBFF;"> uninstall</span></span></code></pre></div><hr><h2 id="does-the-agent-have-a-docker-image" tabindex="-1">Does the Agent Have a Docker Image? <a class="header-anchor" href="#does-the-agent-have-a-docker-image" aria-label="Permalink to &quot;Does the Agent Have a Docker Image?&quot;">​</a></h2><p><strong>The Agent currently does not offer a Docker image.</strong><br> Unlike the Dashboard, which aims to minimize its impact on the host system, the Agent is designed to deeply integrate with the host to perform monitoring services and command execution tasks.</p><p>Although running the Agent inside a container may still allow monitoring, functionalities like WebShell will not work properly. Therefore, the official project does not provide Docker image support.</p>',22),o=[s];function l(r,h,d,c,p,u){return a(),t("div",null,o)}const f=e(n,[["render",l]]);export{m as __pageData,f as default};
